import React from "react"
import {Outlet} from "react-router-dom"

import TavNav from "./TabNav"

const Tabs = (props: any) => {
	const {userName} = props.props
	return (
		<div className="tabs">
			<h1>REPAIRING FROM OF CLIENT{userName}</h1>

			{/** Tab navigation  */}
			<TavNav />
			{/** Tab inner content */}
			<Outlet />
		</div>
	)
}

export default Tabs
